import "./About.css";
function About() {
  return (
    <div className="about">
      <img src="../../Assets/images/img/about.jpg" alt="img" />
      <div className="info">
        <h2>this is Sulaiman</h2>
        <p>he has a big asss</p>
      </div>
    </div>
  );
}
export default About;
